// ==UserScript==
// @name     Sudomemo Theatre (Vapor April Fools Theme)
// @author   Sudomemo, Ghost64
// @namespace  https://www.sudomemo.net/
// @version 1.21
// @description to use this theme, run this script
// @include  *://www.sudomemo.net/*
// @grant    GM_addStyle
// @run-at   document-start
// @downloadURL https://update.greasyfork.org/scripts/472967/Sudomemo%20Theatre%20%28Vapor%20April%20Fools%20Theme%29.user.js
// @updateURL https://update.greasyfork.org/scripts/472967/Sudomemo%20Theatre%20%28Vapor%20April%20Fools%20Theme%29.meta.js
// ==/UserScript==

GM_addStyle ( `
@charset "UTF-8";
:root {
    --theatre-primary: #9765D4;
    --theatre-secondary: #aa80df;
    --header-frog-popular: url(/theatre_assets/theme/sudomemo_vapor/header_frog/popular.png);
    --header-frog-hot: url(/theatre_assets/theme/sudomemo_vapor/header_frog/hot.png);
    --header-frog-news: url(/theatre_assets/theme/sudomemo_vapor/header_frog/news.png);
    --header-frog-spotlight: url(/theatre_assets/theme/sudomemo_vapor/header_frog/spotlight.png);
    --header-frog-ranking: url(/theatre_assets/theme/sudomemo_vapor/header_frog/ranking.png);
    --header-frog-recent: url(/theatre_assets/theme/sudomemo_vapor/header_frog/recent.png);
    --header-frog-comments: url(/theatre_assets/theme/sudomemo_vapor/header_frog/comments.png);
    --header-frog-random: url(/theatre_assets/theme/sudomemo_vapor/header_frog/random.png);
    --header-frog-music: url(/theatre_assets/theme/sudomemo_vapor/header_frog/music.png);
    --header-frog-fans: url(/theatre_assets/theme/sudomemo_vapor/header_frog/fans.png);
    --header-frog-trophies: url(/theatre_assets/theme/sudomemo_vapor/header_frog/trophies.png);
    --bg-vapor-grid: url(data:image/png;base64,);
    --palm-tree-badge: url(data:image/png;base64,);
}

h1,
h2,
h3,
h4,
h5,
h6 {
    color: #fff;
}

.table {
    color: #fff;
}

hr {
    background-color: #fff;
}

.theme-body {
    background-image: url(data:image/gif;base64,);
    background-attachment: fixed;
}

.theme-panel-title {
    color: #ffffff;
    background-color: var(--theatre-primary);
}

.theme-link {
    /* color: #5A02C6 */
    color: #FAFAFA;
}

.theme-link:hover {
    color: unset;
    text-decoration: underline;
}

.theme-link-inverted {
    color: #ffffff;
}

.theme-link-inverted:hover {
    color: #ffffff;
    text-decoration: underline;
}

.theme-navbar-background {
    background-color: #9765D4C2;
    border-color: var(--theatre-secondary);
    border-bottom-width: 2px;
}

.theme-navbar-text li a {
    color: #fff;
}

.theme-navbar-text li a:hover {
    color: var(--theatre-primary);
    background-color: #fff;
}

.theme-navbar-text .open a,
.theme-navbar-text .open a:hover,
.theme-navbar-text .open a:focus {
    color: var(--theatre-primary);
    background-color: #fff;
}

.theme-navbar-text .dropdown-menu a,
.theme-navbar-text .dropdown-menu a:hover,
.theme-navbar-text .dropdown-menu a:focus {
    font-weight: bold;
    color: #5A02C6;
    background-color: #fff;
}


/* hacky fixes 2021.04.01 */

.panel-body-only,
.card-body.theme-panel-body {
    background-color: #aa80dfd4;
    color: white;
}

th.upload-status-indicator .fad.fa-check-circle::after {
    color: white;
}

th.upload-status-indicator .fa-check-circle::before {
    background-color: white;
    border-radius: 50px;
}

div#profile-stats li,
div#flipnote-stats li {
    background-color: white;
}

ul.commentlist .comment {
    background-color: #b071e347;
}

.btn.btn-custom-active {
    background: var(--theatre-secondary);
    border: solid 1px var(--theatre-secondary);
}

.btn-custom {
    color: #946bc8;
    border: 1px solid #946bc8;
}

#welcome-user-preview-stats-1 {
    color: #fff;
}


/* player */


/* Flipnote Player */

.player__controls {
    background: var(--theatre-secondary);
    color: #fff;
}

.player__scrubber {
    background: var(--theatre-scrubber-track);
}

.player__controls a.controls__link {
    color: #fff;
}

.scrubber__track__handle {
    background-color: var(--theatre-primary);
}

.scrubber__track__played {
    background-color: var(--theatre-primary);
}


/* Frog on embedded player */

.controls__sudomemo__link>a>img {
    filter: saturate(0) brightness(100) invert(54%) sepia(78%) saturate(2606%) hue-rotate(228deg) brightness(85%) contrast(94%);
}

.entry-title>h1:nth-child(1) {
    color: white;
}


/* topic banner */

.topic-banner img {
    filter: contrast(1.1) brightness(1.07) hue-rotate(160deg);
}

.topic-banner {
    position: relative;
}

.topic-banner::after {
    position: absolute;
    content: '';
    display: block;
    top: 0;
    left: 0;
    height: 100%;
    width: 100%;
    background: linear-gradient(to bottom, rgb(255, 0, 134) 0%, rgb(0, 117, 255) 100%);
    mix-blend-mode: overlay
}


/* discord ad thing */

a[data-banner-name="discord_slim"] img {
    filter: contrast(1.1) brightness(1.83) hue-rotate(44deg);
}

a[data-banner-name="discord_slim"] {
    position: relative;
}

a[data-banner-name="discord_slim"]:after {
    position: absolute;
    content: '';
    display: block;
    top: 0;
    left: 0;
    height: 100%;
    width: 100%;
    background: linear-gradient(to bottom, rgb(176, 67, 215) 0%, rgb(0, 117, 255) 100%);
    mix-blend-mode: overlay
}


/* welcome banner frogs */

#frog1 img,
#frog2 img {
    filter: hue-rotate(156deg) brightness(1.16);
}

.welcome-frog {
    stroke: #fff;
}

.about-sudomemo .room {
    color: var(--theatre-primary);
    border: 3px solid var(--theatre-primary);
}

.about-sudomemo {
    background-color: var(--theatre-primary);
}

.about-sudomemo p,
.about-sudomemo .big,
.about-sudomemo .left,
.about-sudomemo .right,
.about-sudomemo .room {
    background-color: var(--theatre-primary);
    border: 3px solid var(--theatre-secondary);
    color: white;
}


/* palm trees on user quick details box */

@media(min-width: 350px) {
    .about-sudomemo {
        background: var(--palm-tree-badge), var(--theatre-primary);
        background-repeat: no-repeat;
        background-position-x: right;
        background-blend-mode: lighten;
    }
}

a.navbar-brand {
    content: url(/theatre_assets/theme/sudomemo_vapor/sudomemo_logo_vapor.svg);
}

img.my-0, img.ml-auto, img.mr-0 {
content: url(/theatre_assets/theme/sudomemo_vapor/Sudomemo_Sticker_Fox_Vapor.svg);
}

img.ml-2, img.mr-auto, img.mt-0 {
content: url(/theatre_assets/theme/sudomemo_vapor/sudomemo_logo_vapor.svg);
}

/* navbar froggy + loading frog */
img#frogload { /*, div.navbar > div > div.navbar-collapse {*/
    filter: hue-rotate(156deg) brightness(1.16);
}

/* navbar fixes */

.navbar-custom .navbar-toggler:hover,
.navbar-custom .navbar-toggler:focus {
    background-color: var(--theatre-secondary);
}


/* tint over the whole thing */


/*
body::after {
    content: '';
    position: fixed;
    top: 0;
    left: 0;
    opacity: .1;
    pointer-events: none;
    background: #6764bb;
    width: 100%;
    height: 100%;
}

*/


/* Frog on embedded player */

.controls__sudomemo__link>a>img {
    filter: saturate(0) brightness(100);
}


/* Strange positioning difference in embedded page. */

div.embedded-player .scrubber__track__handle:after {
    top: -4px !important;
}

.panel-common>.card-footer {
    background-color: #b071e347;
}


/* windows xp */

a,
.theme-link {
    font-weight: bold;
    color: #FAFAFA;
    /* text-shadow: -0.4px -0.4px 0.4px #C774E8, 0.4px -0.4px 0.4px #C774E8, -0.4px 0.4px 0.4px #C774E8, 0.4px 0.4px 0.4px #C774E8; */
    text-shadow: -1px -1px 1px #C774E8, 1px -1px 1px #C774E8, -1px 1px 1px #C774E8, 1px 1px 1px #C774E8;
}
/* winxp button */

.btn.btn-custom,
.btn.btn-primary {
    text-align: center;
    color: #070707;
    background: #f8f4f1;
    border: 2px solid;
    border-radius: 4px;
    border-color: #8aa2cb;
}

.btn.btn-custom:hover,
.btn.btn-primary:hover {
    border-bottom-color: #efc47b;
}

.btn.btn-custom:focus,
.btn.btn-primary:focus,
.btn.btn-custom:focus-within,
.btn.btn-primary:focus-within {
    border-bottom-color: #8aa2cb;
}

.card {
    background: #b071e347;
    border-top-left-radius: 8px;
    border-top-right-radius: 8px;
    outline: 0;
}

.card .card-header {
    text-align: left;
    color: #f8f4f1;
    outline: 0;
    width: 100%;
    align-items: center;
}

.card .card-header .card-title {
    text-shadow: 1px 1px #070707;
}

.card .card-body {
    background: #b071e347 !important;
    padding-top: 10px;
    padding-bottom: 10px;
    padding-left: 15px;
    padding-right: 15px;
}

div#welcome-card,
div.profile-head,
div.flipnote-player-card,
div.flipnote-details-card {
    background: var(--bg-vapor-grid), #b071e347;
    border: none;
}

ul.flipnote-list li div.box-container {
    background-color: #5C3D7F;
}

ul.flipnote-list>li.flipnote-list-item>div.flipnote-item-info {
    background-color: var(--theatre-primary);
}

ul.flipnote-list>li.flipnote-list-item>div.flipnote-item-info>span.starcount {
    color: white;
}

span.username i.fa-badge-check {
    color: white;
}

.search-box h1 {
    color: #fff;
}

div.theatre-footer>div>div:nth-child(1) {
    color: #fff;
}


/* more player fixes */

.flipnote-container {
    border: 3px solid var(--theatre-secondary);
    background-color: var(--theatre-secondary);
    border-radius: 14px;
    overflow: hidden;
}

.player__scrubber {
    /* background: var(--theatre-scrubber-track); */
    background: #d4b3ff;
}


/* comments tweak */

ul.commentlist>li>div.comment-container img {
    border-radius: 5px;
}

a.nav-link,
li.dropdown-item a {
    text-shadow: none;
}

/* ticket gifting css fix */
#ticketModal .modal-content {
    background-color: #0e0e22;
    color: #fff;
}

#ticketModal .modal-header {
    background-color: var(--theatre-primary);
}

#ticketModal button.close {
    color: #fff;
}

/* playlists css fix */
#playlist-selection-menu .card-body,
#playlist-manage-menu .card-body {
    background-color: #0e0e22 !important;
}

#playlist-flipnotes {
    color: #000;
}

#playlist-current {
    background-color: #ca98fe;
}

#edit-playlist-visibility-flex .edit-playlist-visibility-opt {
    background-color: #e7f5d5;
}

#edit-playlist-visibility-flex .edit-playlist-visibility-opt.opt-active {
    background-color: #ca98fe;   
    }
   
    
` );